    methods (Access = public, Static = true)
        function p = equatorpoints(d, k)
            dt = pi/k;
            theta = 0:dt:(pi-dt);
            p = [cos(theta); sin(theta); zeros(size(theta))];
            R = vrrotvec2mat(vrrotvec([0 0 1],d));
            p = R*p;
        end
        
